import AppBar from "@mui/material/AppBar";
import Button from "@mui/material/Button";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardHeader from "@mui/material/CardHeader";
import CardMedia from "@mui/material/CardMedia";
import CssBaseline from "@mui/material/CssBaseline";
import Grid from "@mui/material/Grid";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import "./App.css";
import characters from './protagonists.json'
import CharacterCard from './characterCard.js'
import { useState, useEffect} from 'react';








function App() {
  const [dogToShow, setDogToShow] = useState('');
  const [allBreeds, setAllBreeds] = useState([]);
  const [breedCorrect, setBreedCorrect] = useState('');
  useEffect(() => {
    const requestOptions = {
      method: "GET",
      redirect: "follow"
    };
    fetch("https://dog.ceo/api/breeds/list/all", requestOptions)
      .then(response => response.json())
      .then(result => {
        setAllBreeds(Object.keys(result.message));
      })
      .catch(error => console.error(error));
  }, []); // Empty dependency array ensures this runs once on mount

  const getDog = () => {
    const requestOptions = {
      method: "GET",
      redirect: "follow"
    };
    fetch("https://dog.ceo/api/breeds/image/random", requestOptions)
      .then(response => response.json())
      .then(result => {
        setDogToShow(result.message);
        setBreedCorrect(result.message.slice('https://images.dog.ceo/breeds/'.length).split('/')[0]);

        // function makeFourOptionsList(breedCorrect)  {
        //   let num0,num1,num2,num3=0;
        //   num0 = allBreeds.findIndex((x) => x===breedCorrect)


        //   do {
        //     num1 = Math.floor(Math.random() * (allBreeds.length));
        //   } while (num1 === num0)

        //   do {
        //     num2 = Math.floor(Math.random() * (allBreeds.length));
        //   } while (num2 === num0 || num2 === num1)

        //   do {
        //     num3 = Math.floor(Math.random() * (allBreeds.length));
        //   } while (num3 === num0 || num3 === num1 || num3 === num2)

        //   console.log(num0)
        //   console.log(num1)
        //   console.log(num2)
        //   console.log(num3)
        // }
        // let breedCorrect = 'african'
        // makeFourOptionsList(breedCorrect)

      })
      .catch(error => console.error(error));
  };

  return (
    <div className="App">
      <CssBaseline />
      <AppBar
        position="static"
        color="default"
        elevation={0}
        sx={{ borderBottom: "1px solid lightgray" }}
      >
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1 }}>
            Guess My Breed!!
          </Typography>
          <Button
            href="#"
            variant="outlined" 
            sx={{ my: 1, mx: 1.5 }}
            onClick={() => getDog()}
          >
            NEW GAME
          </Button>
          <Button
            href="#"
            variant="outlined" 
            sx={{ my: 1, mx: 1.5 }}
          >
            Score:
          </Button>

        </Toolbar>
      </AppBar>
      <Container maxWidth="md" sx={{ my: 4 }}>




        <Typography
          variant="h5"
          align="center"
          color="text.secondary"
          sx={{ mx: 10 }}
          id = "here"
        >


        </Typography>


      </Container>
      {/* End hero unit */}
      <Container maxWidth="lg" >
        <Grid
          container
          spacing={5}
          justifyContent="center"
          alignItems="flex-start"   
        >

        <Card>
          <CardMedia
          component="img"
          height="350px"
          image = {dogToShow}
          />
        </Card>





        </Grid>

      </Container>
    </div>
  );
}


export default App;
